query sub document in mongoDB<p>I am trying to query the company name and its admin users.</p>
<p>This is my structure:</p>
<pre><code>companies: [
    {
        _id: &quot;generatedComp1Id&quot;,
        name: &quot;abc&quot;,
        users: [
          { _id: &quot;...&quot;, user: &quot;userId1&quot;, roles: [&quot;admin&quot;]},
          { _id: &quot;...&quot;, user: &quot;userId2&quot;, roles: [&quot;user&quot;]}
        ]
    },
    {
        _id: &quot;generatedComp2Id&quot;,
        name: &quot;xyz&quot;,
        users: [
          { _id: &quot;...&quot;, user: &quot;userId3&quot;, roles: [&quot;admin&quot;]},
          { _id: &quot;...&quot;, user: &quot;userId4&quot;, roles: [&quot;admin&quot;]},
          { _id: &quot;...&quot;, user: &quot;userId5&quot;, roles: [&quot;user&quot;]}
        ]
    }

]
</code></pre>
<p>I'm trying to query company <code>name</code> and admin users for each company given a companyId.</p>
<p>Output:</p>
<p>for company ID of <code>generatedComp1Id</code>:</p>
<pre><code>{
    name: &quot;abc&quot;,
    adminUsers: [
        {user: &quot;userId1&quot;}
    ]
}
</code></pre>
<p>for company ID of <code>generatedComp2Id</code>:</p>
<pre><code>{
    name: &quot;xyz&quot;,
    adminUsers: [
        {user: &quot;userId3&quot;},
        {user: &quot;userId4&quot;}
    ]
}
</code></pre>
<p>I tried to do the next thing with no success:</p>
<pre><code>[  
   { $match: {_id: ObjectId(&quot;generatedComp1Id&quot;)}},
   {
        $project: {
            name: 1,
            adminUsers: {
                $filter: {
                    input: &quot;$roles&quot;,
                    as: &quot;role&quot;,
                    cond: {
                        $eq: [&quot;$$role&quot;, &quot;admin&quot;]
                    }
                }                
            }
        }
    }
]
</code></pre>
<p>In addition, I tried <code>unwind</code>:</p>
<pre><code>[
  {$unwind:'$users'}, 
  {$match:{'users.roles':{$in:['admin']}}},
  {$group:{_id:'$_id',users:{$push:'$users'}}},
  { $project: { name: 1 } }
  ]
</code></pre>

