How to find items in collection by string input?<p>In my collection <code>users</code> I have a field <code>registerDate</code> in format ISODate(&lt; string &gt;). I need to send a request to MongoDB. I use vibe.d framework and this one can send only deserialized JSON string. So, the input date can be either &quot;2021-02-28T21:00:00Z&quot; or UNIX timestamp.</p>
<p>In detail:</p>
<p>Works:</p>
<pre><code>db.users.find(
    {
        &quot;registerDate&quot;:{
            &quot;$gte&quot;: ISODate(&quot;2021-02-28T21:00:00Z&quot;), 
            &quot;$lt&quot;: ISODate(&quot;2021-10-31T21:00:00Z&quot;)
            }
    })
</code></pre>
<p>Doesn't work:</p>
<pre><code>&quot;$gte&quot;: {$date: &quot;2021-02-28T21:00:00Z&quot;}, 
&quot;$lt&quot;: {$date:&quot;2021-10-31T21:00:00Z&quot;}
</code></pre>
<p>I also try:</p>
<pre><code>db.users.aggregate([
    { &quot;$project&quot;: {
        &quot;registerDate&quot;: {
            &quot;$gte&quot;: { &quot;$toDate&quot;: &quot;2021-01-07T23:39:49.178Z&quot; },
            &quot;$lt&quot;: { &quot;$toDate&quot;: &quot;2021-09-07T23:39:49.178Z&quot; }
            }
        }
    }])
</code></pre>
<p>Then, I get the error:</p>
<blockquote>
<p><em>&quot;errmsg&quot; : &quot;Invalid $project :: caused by :: FieldPath field names may not start with '$'.&quot;</em></p>
</blockquote>

