Sometimes deleted item is still displayed although view initialization - Vue, Node.js<p>I create app in Vue.js, Node.js and MongoDB. I have a list of items with delete button next to each item. Generally it works, but once, for example 20 deletions, the deleted item stays in the list, although the  list is initialized after each delete. After refreshing page manualy, deleted item is gone. How to fix it?</p>
<p>vue component:</p>
<pre><code> methods: {
    async initialize() {
      return Service.getTool()
        .then((response) =&gt; {
          this.tools = response;
        })
        .catch((error) =&gt; {
          this.handleError(error, this.errors);
        })
        .finally(() =&gt; {
        });
    },
   async deleteItem(id) {
      await Service.deleteTool(id);
      await this.initialize();
    },
}
</code></pre>
<p>service:</p>
<pre><code>    static async getTool() {
        const res = await api.get('tool/get')
        try {
            return res.data;
        } catch (err) {
            return err;
        }
    }
    static deleteTool(id) {
        return api.delete(`${'delete'}/${id}`);
    }
</code></pre>
<p>backend:</p>
<pre><code>router.delete('/delete/:id', (req, res) =&gt; {
  Tool.deleteOne({ _id: req.params.id }, function (err) {
    if (!err) {
      return res.json('Item has been deleted');
    }
    else {
      res.status(500).send(err);
    }
  });
})
</code></pre>

